function Card(props) {
  return (
    <div>
      <h2>{props.name}</h2>
      <img src={props.img} alt="avatar_img" />
      <p>{props.tel}</p>
      <p>{props.email} </p>
    </div>
  );
}

function App() {
  return (
    <div style={{ marginLeft: 100 }}>

    </div>
  );
}

export default App;
